-- Table structure for `ck_info`
-- ----------------------------
DROP TABLE IF EXISTS `ck_info`;
CREATE TABLE `ck_info` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '自增id',
  `name` varchar(255) COLLATE utf8_unicode_ci NOT NULL COMMENT '姓名',
  `mobile` varchar(12) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '手机',
  `gender` tinyint(1) DEFAULT NULL COMMENT '性别：1男 2女',
  `email` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '邮箱',
  `left_eye` varchar(12) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '左眼',
  `right_eye` varchar(12) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '右眼',
