  `login_ip` varchar(50) DEFAULT NULL COMMENT '登录ip',
  `login_time` bigint(20) DEFAULT NULL COMMENT '登录时间',
  `login_region` varchar(100) DEFAULT NULL COMMENT '登录区域',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='会员token表';

